import React, { useState } from 'react';
import { Container, Row, Col, Navbar, Button } from 'react-bootstrap';
import '../sidebar/sidebar.css'; // Import any custom sidebar styles here

function NavBar() {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  function toggleSidebar() {
    setSidebarOpen(!sidebarOpen);
  }

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary nav">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
      </Navbar>
      <Container fluid>
        <Row>
          <Col className={`sidebar bg-body-tertiary ${sidebarOpen ? 'open' : 'closed'}`} lg={3} md={4} sm={6}>
            <Button onClick={toggleSidebar} className="toggle-btn">Toggle Sidebar</Button>
            <ul>
              <li><a href="#">Link 1</a></li>
              <li><a href="#">Link 2</a></li>
              <li><a href="#">Link 3</a></li>
            </ul>
          </Col>
          <Col className="content" lg={sidebarOpen ? 9 : 12} md={sidebarOpen ? 8 : 12} sm={sidebarOpen ? 6 : 12}>
            <h1>Main Content</h1>
            <p>This is the main content area.</p>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default NavBar;
